def canCompleteCircuit(gas, cost):
    s = [(gas[i] - cost[i]) for i in range(len(gas))]
    if sum(s) < 0: return -1
    for i in range(len(s)):
        route = s[i+1::] + s[:i:]
        station1 = s[i]
        while station1 >= 0:
            for j in route:
                station1 += j
                if station1 < 0: break
            if station1 >= 0: return i

